import React from 'react';
import classNames from 'classnames';
import classes from './Cockpit.module.css';
// //import rocky from '../../containers/App.module.css'
// import classNames from 'classnames';
// import classes from './Cockpit.module.css';
// import Navbar from './navBar';

const viewContentOptions = props => {
  //
  let displayOptions = (
    <div>
      <div className="btn-group-toggle d-flex-between" data-toggle="buttons">
        <label className="btn btn-danger m-2 active">
          <button
            type="radio"
            name="options"
            id="option1"
            autoComplete="off"
            onClick={props.viewContent}
            value="0"
          />{' '}
          Cockpit
        </label>

        <label className="btn btn-primary m-2 active">
          <button
            type="radio"
            name="options"
            id="option1"
            autoComplete="off"
            onClick={props.viewContent}
            value="1"
          />{' '}
          Tasks of the Week
        </label>

        <label className="btn btn-success m-2 active ">
          <button
            type="radio"
            name="options"
            id="option2"
            autoComplete="off"
            onClick={props.viewContent}
            value="2"
          />{' '}
          Tasks by Day
        </label>

        <div className="container">
          <div className={classes.specialbtn}>
            <div className="dropdown">
              <label className="btn btn-success m-2 active ">
                <button
                  className="btn dropdown-toggle"
                  type="button radio"
                  //data-target="#navbarNav"
                  data-toggle="dropdown"
                >
                  <span className="navbar-toggler-icon"></span>
                  Tasks by Day
                </button>
              </label>

              <div className="dropdown-menu">
                <div className={classes.specialbtnAllTasks}>
                  <button
                    className="dropdown-item"
                    onClick={props.clicked}
                    value="1"
                  >
                    Monday
                  </button>
                </div>

                <div className={classes.specialbtnTodayTasks}>
                  <button
                    className="dropdown-item"
                    onClick={props.clicked}
                    value="2"
                  >
                    Tuesday
                  </button>
                </div>
              </div>
            </div>
          </div>
        </div>

        <label className="btn btn-warning m-2 ">
          <button
            type="radio"
            name="options"
            id="option3"
            autoComplete="off"
            onClick={props.viewContent}
            value="3"
          />{' '}
          React Syllabus
        </label>
      </div>
    </div>
  );

  return displayOptions;
};

export default viewContentOptions;
